import logoPath from '../images/Vector.svg';
import { Route, Link } from 'react-router-dom';

function Header({
  onSignOut,
  textLink,
  userEmail,
  headerButtonActiveClassName,
}) {
  return (
    <header className="header">
      <img alt="Логотип Mesto" className="logo" src={logoPath} />
      <p className="header__login">{userEmail}</p>
      <button
        onClick={onSignOut}
        className={`header__button ${headerButtonActiveClassName}`}
      >
        <Route path="/signup">
          <Link className="header__button" to="signin">
            Войти
          </Link>
        </Route>
        <Route path="/signin">
          <Link className="header__button" to="signup">
            Регистрация
          </Link>
        </Route>
        <Route path="/signin">
          <Link className="header__button" to="signup">
            Выйти
          </Link>
        </Route>
      </button>
    </header>
  );
}

export default Header;
